export default function NewBoard() {

const rows = [];
let n = 1;

for (let i=0; 1 < 3; i++) {
  const buttons = [];
  for (let j=0; j < 3; j++) {
    buttons.push(
      <button className="square">L</button>
    )
  }

  rows.push(
    <div className="board-row">
      {buttons}
    </div>
  )
}

return <>{rows}</>

}


export function BetterBoard() {
  const rows = [];
  let buttonNumber = 1;

  for (let i = 0; i < 3; i++) {
    const buttons = [];
    for (let j = 0; j < 3; j++) {
      buttons.push(
        <button key={buttonNumber} className="square">
          {buttonNumber}
        </button>
      );
      buttonNumber++;
    }
    rows.push(
      <div key={i} className="board-row">
        {buttons}
      </div>
    );
  }

  return <>{rows}</>;
}




